sys_variable_value.value:
(function execute(inputs, outputs) {
    var utils = new TaskUtils();

    // Fetch all tasks for a specific event (by event_id string)
    outputs.tasks_by_event_json = JSON.stringify(
        utils.getTasksByEvent(inputs.event_id || '')
    );

    // Fetch details for a particular task
    outputs.task_details_json = JSON.stringify(
        utils.getTaskById(inputs.task_number || '')
    );

    // Is the task overdue?
    var overdue = utils.isTaskOverdue(inputs.task_number || '');
    outputs.overdue_status_str = overdue ? 'true' : 'false'; // Always a simple string!

    // Fetch all tasks by due date
    outputs.tasks_by_due_date_json = JSON.stringify(
        utils.getTasksByDueDate(inputs.due_date || '')
    );
})(inputs, outputs);

